import React from 'react'
import { useSelector } from 'react-redux'
import "./Home.css"
function Home() {

  const cards=useSelector(store=>store.cards)
  console.log(cards);

  return (
    <div >
      <img src="static/home/img1.png" alt="img" />
    </div>
  )
}

export default Home
